function (source, callback) {

   var valColumns = ["Forecast", "Demand", "Lo95", "Hi95"];

  var meta = {
	  "time": 12 // Timestamp type
	};

	var keyMetric = "Demand";

	var multipliers = {

			"Hi95": 1.2,
			"Lo95": 0.8,
			"Demand": 1,
			"Forecast": 1
	};

	var columns = ["time"];

	var minStart = 160;
	var maxStart = 220;

	// Add the value columns and set their data types
	for(var i = 0; i < valColumns.length; i++){
		columns.push(valColumns[i]);
		meta[valColumns[i]] = 9; // Float type
	}

	var numReadings = 100;
	function randomNumber(min, max){
			return Math.random() * (max - min) + min;
	}

	function randomPoint(lastVal){
		return randomNumber(lastVal * 0.95, lastVal * 1.05);
	}

	function randomNoise(val){
		return val* randomNumber(0.95, 1.05);
	}

	function randomChart(startDate){

		var date = startDate;
		var numDatapoints = 50;
		var rows = [];
		var HOURS_TO_MILLIS = 60*60*1000;
		while(rows.length < numDatapoints){
			var nextDate = new Date();
			var numHoursToAdd = rows.length;
			nextDate.setTime(date.getTime() + (numHoursToAdd*HOURS_TO_MILLIS)); 			
			var row = {time: nextDate};
			var i;
			if (rows.length == 0){
				var val = randomNumber(minStart, maxStart);
				for( i = 0 ;i < valColumns.length; i++){
					var multiplier = multipliers[valColumns[i]];

					row[valColumns[i]] = randomNoise(val * multiplier);
				}

			}
			else{

				var lastVal = rows[rows.length - 1][keyMetric];
				var nextVal = randomPoint(lastVal);

				for( i = 0 ;i < valColumns.length; i++){
					var multiplier = multipliers[valColumns[i]];

					row[valColumns[i]] = randomNoise(nextVal * multiplier);
				}
			}

			// Add the datapoint to the result
			rows.push(row);


		}
		return rows;	
	}

	var startDate = new Date();

	var result = {
		columns: columns,
		meta: meta,
		rows:randomChart(startDate)
	};

    callback(result);

}

